window.dataLayer = window.dataLayer || [];
window.dataLayer.push({
  event: 'begin_checkout',  			// name of the event. In this case, it always must be begin_checkout
  ecommerce: {							
    items: [{							// an array with all products (that were in a cart when the checkout began)
      item_name: 'Vuse ePod 2 Device - Closed Pod System',          // insert an actual product name
      item_id: '6589',              // insert an actual product ID
      price: 14.99,                 // insert an actual product price. Number or a string. Don't include currency code
      item_brand: 'Vuse/Vype',          // insert an actual product price
      item_category: 'Vape Kits+Vapes & E-cigs',            // insert an actual product top-level category/
      item_variant: 'Blue',             // insert an actual product variant
      item_list_name: 'Filter', // insert the name of the list where the product is currently displayed
      item_list_id: 'instock=true&price=10-50&manufacturer=Vuse/Vype&batterycapacity=350mAh',   // insert the list id where the product is currently displayed
      index: 0,                         // insert product's position in that list
      quantity: '1'                     // product quantity. In case of view_item_list, it will usually be equal to 1

    }]
  }
});
